import { useState } from 'react';
import axios from 'axios';
import { LineChart, Line, XAxis, YAxis, Tooltip, CartesianGrid } from 'recharts';

interface SunEvent {
  date: string;
  sunrise_time: string;
  sunset_time: string;
  golden_hour_start: string;
}

function App() {
  const [location, setLocation] = useState('');
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [data, setData] = useState<SunEvent[]>([]);

  const fetchData = async () => {
    try {
      const response = await axios.get('http://localhost:3000/sunrise', {
        params: { location, start_date: startDate, end_date: endDate }
      });
      setData(response.data);
    } catch (error) {
      alert('Error fetching data');
    }
  };

  return (
    <div style={{ padding: '20px' }}>
      <h1>Sun Event Tracker</h1>
      <input 
        placeholder="Location" 
        value={location} 
        onChange={e => setLocation(e.target.value)} 
      />
      <input 
        type="date" 
        value={startDate} 
        onChange={e => setStartDate(e.target.value)} 
      />
      <input 
        type="date" 
        value={endDate} 
        onChange={e => setEndDate(e.target.value)} 
      />
      <button onClick={fetchData}>Get Data</button>

      {data.length > 0 && (
        <>
          <h2>Results</h2>
          <table>
            <thead>
              <tr>
                <th>Date</th>
                <th>Sunrise</th>
                <th>Sunset</th>
                <th>Golden Hour Start</th>
              </tr>
            </thead>
            <tbody>
              {data.map(event => (
                <tr key={event.date}>
                  <td>{event.date}</td>
                  <td>{event.sunrise_time}</td>
                  <td>{event.sunset_time}</td>
                  <td>{event.golden_hour_start}</td>
                </tr>
              ))}
            </tbody>
          </table>

          <LineChart width={600} height={300} data={data}>
            <CartesianGrid stroke="#ccc" />
            <XAxis dataKey="date" />
            <YAxis />
            <Tooltip />
            <Line type="monotone" dataKey="sunrise_time" stroke="#8884d8" />
            <Line type="monotone" dataKey="sunset_time" stroke="#82ca9d" />
          </LineChart>
        </>
      )}
    </div>
  );
}

export default App;
